            "banned": 0,
            "closed": 0,
            "comment": "<strong>РАБОТА ДЛЯ КИТАЯНКИ В КИЕВЕ</strong><br><br>Познакомился в Гуанчжоу с тнёй местной, ну как местной, из провинции но примерно из тех краёв.<br>И вот теперь мне пора уезжать домой по работе а китаянка хочет со мной. Сама она 26 лвл, автослесарь, на сервисе лэндроверовском работала. Я её предупредил что дома своей квартиры у меня нет и не было, она сказала что похуй, тут(в Гуанчжоу) снимает комнату и там будет снимать. Я ей тонко намекнул что постоянно содержать её за свой счёт не смогу. Сказала похуй, будет там подрабатывать.<br>Загвоздка в том что она по-русски аще нихера не понимает. Родной для неё кантонский, общаемся по-английски на котором она вполне сносно говорит.<br>Как она там жить будет у меня дома? Реально ли в Киеве устроить на работу на СТО иностранку которая способна обьясняться только по-английски?<br>Если не найдёт работу по спецухе, автослесарем, то куда её пристроить? Инбифо &quot;пиздой торговать&quot;.<br>Была мысль устроить её в Киеве переводчиком на внешнеэкономическую деятельность в фирму торгующую с косоглазыми через Гуанчжоу или Гонконг. Но опять же, английский у неё чисто бытовой, без деловой лексики. То есть переводчик для бизнеса из неё так себе, ведь там надо помимо китайского и английский знать в совершенстве.<br><br>Пикрандом.",
