            "banned": 0,
            "closed": 0,
            "comment": "Почему нет треда?<br><br>В Следственном комитете РФ установили личность мужчины, совершившего взрыв в вагоне поезда метро в Санкт-Петербурге. Им оказался Акбаржон Джалилов 1995 года рождения.<br><br>Кроме того, эксперты-криминалисты обнаружили генетические следы Джалилова на сумке, оставленной на станции метро &quot;Площадь Восстания&quot;, в которой находилось взрывное устройство. Причём не только заключение генетической экспертизы, но и камеры позволили следователям сделать такой вывод.<br><br><br>Как уже ранее сообщали, Государственный комитет национальной безопасности Киргизии допросил родственников Джалилова. По предварительным данным, он занимался непосредственной подготовкой преступления и лично покупал необходимое для изготовления взрывного устройства. Его тело найдено на месте взрыва в подземке.<br><br><br>МИД Киргизии заявил, что предполагаемый исполнитель теракта в петербургском метро Акбаржон Джалилов никогда не являлся гражданином республики. «По имеющимся данным Акбаржон Джалилов родился 1 апреля 1995 года в городе Ош, этнический узбек, имел неполное среднее образование,— отмечается в заявлении ведомства.—Он никогда не получал паспорт гражданина Кыргызской Республики, так как в 2011 году по достижению 16-летнего возраста он в соответствии с поданным им заявлением и ходатайством отца, гражданина России, получил паспорт гражданина РФ и с этого времени постоянно проживал на территории Российской Федерации».<br><br><a href=\"https:&#47;&#47;vk.com&#47;akbarjonjalilov\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">https:&#47;&#47;vk.com&#47;akbarjonjalilov</a><br><a href=\"https:&#47;&#47;vk.com&#47;id323460310\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">https:&#47;&#47;vk.com&#47;id323460310</a><br><a href=\"https:&#47;&#47;vk.com&#47;akbarjons\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">https:&#47;&#47;vk.com&#47;akbarjons</a><br><br>шерлоки, гоу. че еще можно нарыть?",
