            "comment": "<strong>Детям до 14 лет хотят запретить социальные сети. <br>А остальных пускать только под настоящим именем по паспорту</strong><br><br>Такой законопроект от депутатов Ленинградской области собираются внести в Госдуму в среду.<br><br>Согласно законопроекту «О правовом регулировании деятельности социальных сетей и о внесении изменений в отдельные законодательные акты» пользователем соцсети может быть только лицо, достигшее возраста 14 лет. Создавать страницу можно только одну и только под настоящим именем и фамилией, иначе последует штраф: владельцу сайта — до 300 тысяч рублей, пользователю — до 5 тысяч, пишет газета «Известия».<br><br>Пользователям, не достигшим 18 лет, запрещается вступать в сообщества, где размещена запрещенная для детей информация. В противном случае родителям придется заплатить штраф до 2 тысяч рублей. Продажа несовершеннолетним любых товаров через соцсети тоже будет караться законом. Кроме того, документ предполагает запрет на рекламу «оккультно-магического характера и курительных смесей».<br><br>«Ради общественной безопасности необходимо ввести принцип поголовной верификации пользователей, это можно сделать только с момента получения гражданином паспорта — с 14 лет. Никто не пытается ввести цензуру или ограничить свободу слова. Верификация и строгий контроль за подлинностью имен лишь усилит цену собственного мнения и виртуального общения», — высказался один из авторов законопроекта, депутат заксобрания Ленобласти Владимир Петров.<br><br><span class=\"spoiler\"><a href=\"http:&#47;&#47;izvestia.ru&#47;news&#47;676127\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">http:&#47;&#47;izvestia.ru&#47;news&#47;676127</a></span>",
