            "banned": 0,
            "closed": 0,
            "comment": "Тема нихуя не интересная, и обсосанная, но ищу советов и поддержки (ха!), поехали. <br><br>На связи тян, 22 лвл. Так вышло, что проебланила последние 5 лет, а именно после окончании школы, попрыгала по вузам (и по хуям, да-да), и в результате не отучилась целиком ни одного курса.  А причина тому довольно проста - меня бесит современная структура образования в нашей стане (надежда что у буржуев все получше с этим, но я не ебу честно). <br>Тебя хуесосят 11 лет, потом хлопают по плечу, говорят, что теперь ты взрослый и начинаешь новую жизнь, а по сути тебя просто хуесосят еще 4 (в лучшем случае) года.<br>Я хочу учиться, рили, более того, у меня сложно с самообразованием и я всегда предпочитала учиться с педагогом. Но блять отчитываться за прогулы, опоздания, слушать ненужную хуйню половину обучения? <br>Моя мечта, приходить на лекции, вести конспекты и сдавать письменный экзамен, что бы ко мне относились как к человеку и оценивали мои знания не бабки с промытыми ТВ мозгами, а квалифицированные педагоги. Но хуй там плыл ессесна. На работу без опыта и образования устроиться крайне сложно. Да, я знаю, чтобы зарабатывать, не нужна корочка, но я не обладаю харизмой или связями, чтобы протиснуться куда-то. А это значит, что чтобы мои среднестатистические мозги взяли на работу, мне нужен диплом о высшем образовании. <br><br>Вот такая вот петля. <br>Ну и по классике, делись советами, сосач, как выживаешь и чем на оплату подписки порнохаба зарабатываешь<br>",
