            "comment": "<strong>Стори:</strong><br>Великовозрастный урод на скейте врезался в женщину, и, вместо того, чтобы извиниться, нахамил ей (в его интерпретации произошёл обмен грубостями, но, как мне кажется, если ты врезался в женщину и она от испуга матюгнулась, то извиняться должен ты). Женщина позвонила хахалю, тот нарвался на драку и был скейтером избит. В комментах настоящая пьянка - малолетние ублюдки что-то пиздят про тупых баб, про быдло, понаехавшее из деревни - и никто не просекает главного: допустим, ваша мамка идёт по улице, подвергается наезду, потом хамству, просит вашего папку вмешаться - и в итоге оба получат пиздов и после этого &quot;не быдло&quot; ещё и становится героем. Разве это нормально?<br>Я пару раз пересмотрел ролик и вдруг понял, что мне не хочется сочувствовать <em>передовой молодежи</em> - особенно после чтения комментов на ютубе. Почему-то я сочувствую именно &quot;быдлу&quot;. Может, потому, что во мне говорит хикка, которая не чувствует ни малейшего родства с этим холёным пижончиком на скейте? Это же типичная социоблядь - тупая, эгоистичная и самовлюблённая. Я не люблю быдло, но в данной ситуации, как мне кажется, оно право. И даже сама ситуация вызвала отклик в моей душе - быдлан свалил скейтера с ног, пока тот был на колесах, но в итоге соснул в честной драке. У меня была похожая ситуация в 7 классе - альфа, травивший меня, обозвал мою мать гадиной и я, весь урок вынашивая план мести, подошел к нему на перемене в раздевалке и толкнул в спину - в итоге альфа запнулся от рюкзак и упал лицом на скамью. Не знаю, как я решился - видимо, я просто накрутил себя за 40 минут. Альфа ушел вытирать нос к доктору. Стоит ли говорить, что после пары уроков этот альфа запинал меня до слез после уроков?<br><br><a href=\"https:&#47;&#47;www.youtube.com&#47;watch?v=gDZGvgez1sc\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">https:&#47;&#47;www.youtube.com&#47;watch?v=gDZGvgez1sc</a><br><br>Предлагаю узнать личные данные героев драмы и сделать всё, чтобы данный случай получил наибольшую огласку в СМИ. Найти избитого быдлана, узнать, подал ли он заяву, добиться хотя бы административки для этого хуйлана на колесах. В общем, любыми способами подгадить ему жизнь. <br><br><a href=\"https:&#47;&#47;www.instagram.com&#47;k1rp14&#47;\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">https:&#47;&#47;www.instagram.com&#47;k1rp14&#47;</a>",
